import React from 'react';
import { Box, Typography, Link } from '@mui/material';
import { styled } from '@mui/system';

const StyledFooter = styled(Box)({
  backgroundColor: '#000000',
  color: '#ffffff',
  padding: '20px',
  textAlign: 'center',
  position: 'relative',
  bottom: 0,
  width: '100%',
});

const Footer = () => {
  return (
    <StyledFooter>
      <Typography variant="h6" gutterBottom>
        Baa M Boo
      </Typography>
      <Typography variant="body2" gutterBottom>
        Premium Oversized Tees for Men & Women | Cash on Delivery
      </Typography>
      <Box sx={{ marginTop: '10px' }}>
        <Link href="#privacy" sx={{ color: '#ffffff', margin: '0 10px', textDecoration: 'none' }}>
          Privacy Policy
        </Link>
        <Link href="#terms" sx={{ color: '#ffffff', margin: '0 10px', textDecoration: 'none' }}>
          Terms of Service
        </Link>
        <Link href="#contact" sx={{ color: '#ffffff', margin: '0 10px', textDecoration: 'none' }}>
          Contact Us
        </Link>
      </Box>
      <Typography variant="caption" sx={{ marginTop: '10px', display: 'block' }}>
        Â© 2025 Baa M Boo. All rights reserved.
      </Typography>
    </StyledFooter>
  );
};

export default Footer;
